import React from "react";
import PieChartComponent from "./PieChartComponent";
import PieChartBeverage from "./PieChartBeverage";
import BarChartComponent from "./BarChartComponent";
import RouteLineChart from "./RouteLineChart";
import AgeGroupDetails from "./AgeGroupDetails";
import RouteInsightBox from "./RouteInsightBox";
import RouteFilter from "./RouteFilter";
import "../index.css";
import logo from "../assets/inflight-logo.png";

function Dashboard() {
  return (
    <div style={{ padding: "1.5rem", background: "linear-gradient(to bottom right, #e0f9ff, #d0f9dc)", minHeight: "100vh" }}>
      {/* Header */}
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center", marginBottom: "1.5rem" }}>
        <div style={{ display: "flex", alignItems: "center" }}>
          <img src={logo} alt="In-Flight Insights Logo" style={{ height: "55px", marginRight: "12px" }} />
          <h1 style={{ fontSize: "1.8rem", fontWeight: "bold", color: "#2575fc" }}>‚úàÔ∏è In-Flight Insights Dashboard</h1>
        </div>
        <div style={{ display: "flex", gap: "1.5rem", fontWeight: "bold", color: "#2575fc", fontSize: "0.95rem" }}>
          <span>Dashboard</span>
          <span>Reports</span>
          <span>Settings</span>
          <span>Profile</span>
        </div>
      </div>

      {/* KPI Section */}
      <div style={{ display: "flex", justifyContent: "space-between", marginBottom: "1rem", gap: "1rem" }}>
        {[
          { icon: "üí∞", title: "Cost Savings", value: "$1.2M" },
          { icon: "‚ôªÔ∏è", title: "Waste Saved", value: "210 kg" },
          { icon: "‚úàÔ∏è", title: "Routes Analyzed", value: "350" },
          { icon: "üåç", title: "CO‚ÇÇ Saved", value: "28 tonnes" },
        ].map((kpi, i) => (
          <div key={i} style={{
            flex: 1,
            background: "linear-gradient(to right, #e0f9dc, #e0f3ff)",
            borderRadius: "10px",
            padding: "1rem",
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            boxShadow: "0 2px 6px rgba(0,0,0,0.08)",
          }}>
            <h3 style={{ fontSize: "1.2rem", margin: "0 0 0.3rem 0" }}>{kpi.icon} {kpi.title}</h3>
            <p style={{ fontSize: "1.6rem", fontWeight: "bold", margin: 0 }}>{kpi.value}</p>
          </div>
        ))}
      </div>

      {/* Route Filter */}
      <div style={{ display: "flex", justifyContent: "center", margin: "1rem 0" }}>
        <RouteFilter />
      </div>

      {/* Consumption + Waste Trend */}
      <div style={{ display: "flex", gap: "1rem", marginBottom: "1rem" }}>
        {/* Pie Charts */}
        <div style={{ flex: 1, background: "#f8f8f8", borderRadius: "10px", padding: "1rem" }}>
          <h3 style={{ textAlign: "center", fontWeight: "bold" }}>Consumption Breakdown</h3>
          <div style={{ display: "flex", justifyContent: "space-around", marginTop: "1rem" }}>
            <div>
              <h4 style={{ textAlign: "center" }}>Food</h4>
              <PieChartComponent />
            </div>
            <div>
              <h4 style={{ textAlign: "center" }}>Beverages</h4>
              <PieChartBeverage />
            </div>
          </div>
        </div>

        {/* Line Chart */}
        <div style={{ flex: 1, background: "#f8f8f8", borderRadius: "10px", padding: "1rem" }}>
          <h3 style={{ textAlign: "center", fontWeight: "bold" }}>Waste Trend</h3>
          <RouteLineChart />
        </div>
      </div>

      {/* Age Group Bar Chart */}
      <div style={{ marginBottom: "1rem" }}>
        <h3 style={{ fontWeight: "bold" }}>Waste by Age Group</h3>
        <BarChartComponent />
      </div>

      {/* Age Group Details + Route Insights */}
      <div>
        <AgeGroupDetails />
        <RouteInsightBox />
      </div>
    </div>
  );
}

export default Dashboard;
